         screen->palette[8] = 0x3AFE;
         screen->palette[9] = 0xFFFF;
         screen->palette[10] = 0x0000;
         screen->palette[11] = 0x0000;
         screen->palette[12] = 0x0000;
         screen->palette[13] = 0x0000;
         screen->palette[14] = 0x0000;
         screen->palette[15] = 0x0000;
         break;
